import React, { useState, useEffect } from 'react';
//import { useSpring, animated } from 'react-spring';
//import { useEffect, useState } from 'react';

import { createClient } from '@supabase/supabase-js';

const supabase = createClient('https://mykanhamhzdazpiimhbf.supabase.co', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Im15a2FuaGFtaHpkYXpwaWltaGJmIiwicm9sZSI6ImFub24iLCJpYXQiOjE2ODE4MTQzMTgsImV4cCI6MTk5NzM5MDMxOH0.JEczcrpmt5XMwuPJOTM9SOzXl6D-3AETjQ3KBOliWv0');

function Card() {
  const [cards, setCards] = useState([]);

  useEffect(() => {
    const fetchCards = async () => {
      const { data, error } = await supabase.from('cards').select('title', 'content');
      if (error) throw error;
      setCards(data);
    };
    fetchCards();
  }, []);

  return (
    <div>
      {cards.map(card => (
        <div className="card" key={card.title}>
          <h2>{card.title}</h2>
          <p>{card.content}</p>
        </div>
      ))}
    </div>
  );
}

export default Card;
